import styled from 'styled-components';

export const Wrapper = styled.div`
  padding: 2rem 2rem;
  margin-bottom: 2rem;
`;

export const NavWrap = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;
